package mypracties;

public class PrintOddNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//to print odd numbers 1 to 10
		int result = 0 ;
		int i ;
		for( i=1 ;i<=10;i++)
		{
			 result = i % 2;
				
			 if(result == 1) 
			 {		 
				 System.out.println(i);		
			 }
			 
		}

		
}
	

			





}
